let gameOverEvent = new CustomEvent("gameover", {
  bubble: true,
  cancelable: true,
});
let gameWonEvent = new CustomEvent("gamewon", {
  bubble: true,
  cancelable: true,
});
let level = 1;

// Step 1: Create a class for the whole setup
class Main {
  // Step 2: a constructor that'd initiate the game
  constructor(level, svgChoice) {
    this.level = level;
    this.svgChoice = svgChoice;
    this.createBoxes(1, level);
    this.previewGame();
  }

  // Step 3: a variable class field that'd act as storage
  variables = {
    timer: null,
    doOnce: 0,
    timeDiff: 0,
    customTime: 0,
    stopTimer: 0,
    previewing: true,
    shuffledBoxes: null,
    currentPick: null,
    previousPick: null,
    samePickCounter: 0,
    completedElems: Array(Math.pow(level, 2)).fill(false),
    rotated: Array(Math.pow(level, 2)).fill(false),
    won: false,
    gameOver: false
  };

  // Step 4: create a method for creating boxed in the gameboard
  createBoxes(start, totalColumns) {
    // Step 5: for simplicity, store "this.variables" obj in a variable called 'v'
    const v = this.variables;
    // Step 6: gameboard total no of columns should not exceed 12
    totalColumns = totalColumns > 12 ? 12 : totalColumns;
    // Step 7: total columns are applied using css :root variables
    document.documentElement.style.setProperty("--columns", totalColumns);
    const totalBoxes = Math.pow(totalColumns, 2);
    // Step 8: invoke theHeart method in step 9 which returns shuffled gameItems for the gameboard 
    v.shuffledBoxes = this.theHeart();
    // Step 19: creation of all boxes needed for the gameboard 
    while (start <= totalBoxes) {
      let box = document.createElement("div");
      let front = document.createElement("div");
      let back = document.createElement("div");
      box.className = "box";
      front.className = "front";
      back.className = "back";
      back.innerHTML = this.svgChoice[v.shuffledBoxes[start - 1]];
      box.append(front, back);
      document.querySelector(".gameboard").append(box);
      start++;
    }
  }

  // Step 9: a method that serve as... well the heart of the game
  theHeart() {
    // Step 10: create empty array to store game items
    let gameItems = [];
    let sVGKeys = Object.keys(this.svgChoice);
    // step 11: shuffle svgKeys indexes by invoking shuffle method in step 12
    let sVGKeysIndexes = this.shuffle(sVGKeys.map((e, index) => index));
    // Step 13: create array with repitition values e.g [1, 2, 3, 4], then shuffle it
    let repitition = this.shuffle(
      [...Array(Math.min(level, 4))].map((e, i) => (e = i + 1))
    );

    /* 
    Step 14: create a for loop that goes through each elements in step 11 and create a repitition of the elements using the values in step 13 array
    E.g let elem = [cow, sheep, goat]; let repitition = [2,1,2];
    forLoopResult = [cow, cow, sheep, goat, goat];
    That's basically what this for loop does
    */
    for (let i = 0, j = Math.min(level - 1, 4); i <= sVGKeysIndexes.length; i++, j--) {
       
       // Step 18: if gameItems arr has been filled up enough to fill the gameboard, Terminate the for loop
      if (gameItems.length > Math.pow(level, 2)) {
        gameItems.length = Math.pow(level, 2); //shorten array
        this.shuffle(gameItems);
        return gameItems;
      }
      // Step 15: if loop has gotten to sVGKeysIndexes last value(step 11) && gameItems arr hasn't completed in step 18, restart loop
      if (i > sVGKeysIndexes.length - 1) {
        i = 0;
        sVGKeysIndexes = this.shuffle(sVGKeys.map((e, index) => index));
      }

      // Step 16: form new repitition arr everytime j < 0 && step 18 condition hasn't been met
      if (j < 0) {
        j = Math.min(level - 1, 4);
        repitition = this.shuffle(
          [...Array(Math.min(level, 4))].map((e, i) => (e = i + 1))
        );
      }
      
      //step 17: for the "j" in repitition arr, push the "i" value in sVGKeysIndexes array the num of times specified in repitition[j]
      let times = repitition[j];
      while (times >= 1) {
        gameItems.push(sVGKeys[sVGKeysIndexes[i]]);
        times--;
      }
    }
  }

  // Step 12: a method that takes an array and shuffles it
  shuffle(arr) {
    for (let i = arr.length - 1; i > 0; i--) {
      let j = Math.floor(Math.random() * (i + 1));
      [arr[i], arr[j]] = [arr[j], arr[i]];
    }
    return arr;
  }
  
  // Step 20: a timer method created using requestAnimationFrame
  createTimer(JS_Timestamp) {
    const v = this.variables;
    // Step 21: get the diff btw each requestAnimationFrame timestamps and add it to customTime
    if (v.doOnce <= 0) {
      v.timeDiff = JS_Timestamp;
      v.doOnce++;
    }

    v.timeDiff = JS_Timestamp - v.timeDiff;
    v.customTime += v.timeDiff;

    let elapsedTime = (v.customTime / v.stopTimer) * 100;
    document.documentElement.style.setProperty("--timer", `${elapsedTime}%`);
    (v.customTime >= v.stopTimer) ? this.timerStopFunc() : (v.timer = requestAnimationFrame(this.createTimer));
    v.timeDiff = JS_Timestamp;
  }

// Step 22: function to invoke timer creation in step 20
  timerStartFunc(value) {
    const v = this.variables;
    v.stopTimer = value;
    this.createTimer = this.createTimer.bind(this);
    v.timer = requestAnimationFrame(this.createTimer);
  }

// Step 23: function to cancel created requestAnimationFrame timer in step 20
  timerStopFunc() {
    const v = this.variables;
    cancelAnimationFrame(v.timer);

    // Step 24: IIFE to reset all variables used in step 20.... in order for a new timer to be created(if needed)
    (function resetTimer() {
      v.doOnce = 0;
      v.timeDiff = 0;
      v.customTime = 0;
    })();
    
    // Step 27: if timer for preview mode has elapsed, start main main or skip this if you came from step 37
    if (v.previewing) {
      v.previewing = false;
      // Step 28: invoke function in step 29 to begin the game
      this.begin();
      return;
    }

    // Step 38: game is over, but is it by user winning the game(Step 39) or time elapsed before the user could win(step 40)
    v.gameOver = true;
    v.won ? document.querySelector(".gameboard").dispatchEvent(gameWonEvent) : document.querySelector(".gameboard").dispatchEvent(gameOverEvent);
  }
  
  // Step 25: create function to be invoked by the constructor to start first part of the game 
  previewGame() {
     // Step 26: setTimeout to 0 so that the slide css transition can work properly without other code execution interrupting
    setTimeout(() => {
      document.querySelectorAll(".front").forEach((e) => e.classList.add("slide"));
      this.timerStartFunc(level * 3000);
    }, 0);
  }
  
  // Step 29: function for user interaction with the game 
  begin() {
    const v = this.variables;
    document.querySelectorAll(".front").forEach((e) => e.classList.remove("slide"));
    
    // Step 30: function to check for matching game items clicked by user
    let func = () => {
      document.querySelectorAll(".box").forEach((e, index) => {
        e.classList.add("rotate");
        e.addEventListener("click", (e) => {
           // Step 31: if box clicked is rotated already or game is over, Do Not Proceed
          if(v.gameOver || v.rotated[index]) return;
          
          let clickedBox = e.target.parentElement;
          clickedBox.style.transform = "rotateY(-180deg)";
          v.currentPick = v.shuffledBoxes[index];
          // Step 32: if the users current pick is not the same with the previous pick, close all unmatched boxes and reset counter
          if (v.previousPick !== v.currentPick) {
            v.samePickCounter = 0;
            v.completedElems.forEach((e, i) => {
              if (e === false) {
                document.querySelectorAll(".box")[i].style.transform =
                  "rotateY(-0deg)";
                  v.rotated[i] = false
              }
            });
            clickedBox.style.transform = "rotateY(-180deg)";
          }
          v.rotated[index] = true;
          // Step 33: invoke setCompleted function in step 34
          this.setCompleted(v.currentPick);
          v.previousPick = v.currentPick;
        });
      });
    };

    setTimeout(() => {
      func();
      console.log(Math.pow(level,2) * 3000)
      this.timerStartFunc(Math.pow(level,2) * 3000);
    }, 750);
  }

  // Step 34: check if a full set of game items has been completed 
  setCompleted(pick) {
    const v = this.variables;
    let occurence = v.shuffledBoxes.filter((e) => e === pick).length;
    v.samePickCounter++;
    if (v.samePickCounter >= occurence) {
      v.samePickCounter = 0;
      let allPickedIndex = v.shuffledBoxes
        .map((e, i) => (e === pick ? i : ""))
        .filter(Number.isInteger);
      allPickedIndex.forEach((e) => {
        v.completedElems[e] = true;
        document.querySelectorAll(".box")[e].classList.add("change");
      });
      // Step 35: if step 34 is true, add a bonus timer
      v.customTime -= allPickedIndex.length * 1000;
    }
    
    //Step 36: IIFE to know if all game items has been matched correctly...
    (() => {
      let allCompleted = v.completedElems.every((e) => e === true);
      if (allCompleted) {
         // Step 37: if step 36 is true, then the user won before the timer elapsed, call step 23 again 
        v.won = true;
        this.timerStopFunc();
      }
    })();
  }
}


document.querySelector(".start").addEventListener("click", newLevel);
document.querySelector(".info").addEventListener("click", () => {
  document.querySelector(".full-info").classList.remove("hide");
});
document.querySelector(".exit").addEventListener("click", () => {
  document.querySelector(".full-info").classList.add("hide");
});
document.querySelector(".gameboard").addEventListener("gamewon", () => {
   // Step 39: if user passed level 11, All levels completed... else go to next level 
   if(level > 11){
    document.querySelector(".full-info").innerText = `YOU WON. \r\n No One Has Ever Won Before. \r\n Thanks For Playing, CONGRATULATIONS.`;
    document.querySelector(".full-info").classList.remove("hide");
   } else{
    document.querySelector(".full-info").innerText = `Level ${level} starts in 3 seconds...`;
    document.querySelector(".full-info").classList.remove("hide");
    setTimeout(newLevel, 3000);
   }
});
document.querySelector(".gameboard").addEventListener("gameover", () => {
   // Step 40: Game lost, restart game from beginning automatically 
  document.querySelector(".full-info").innerText = `YOU LOST. \r\n NEW GAME STARTS IN 5 SECONDS... \r\n DO BETTER`;
  document.querySelector(".full-info").classList.remove("hide");
  level = 1;
  setTimeout(newLevel, 5000);
});
function newLevel() {
  document.querySelectorAll(".box").forEach((e) => e.remove());
  document.querySelector(".full-info").classList.add("result", "hide");
  document.querySelector(".interface").classList.add("hide");
  ++level;
  let allSVG = [brand, people, countries];
  let chosenSVG = allSVG[document.querySelector(".svg-choice").selectedIndex];
  new Main(level, chosenSVG);
}

